import s from './nav-bar.module.css'
import ToolBar from "./ToolBar/toolBar";

let addressData = [
    {address: "/profile", id: 1, name: "Profile"},
    {address: "/messages", id: 2, name: "Messages"},
    {address: "/news", id: 3, name: "News"},
    {address: "/music", id: 4, name: "Music"},
    {address: "/settings", id: 5, name: "Settings"},
]

let addressElement = addressData.map( nav1 => <ToolBar address={nav1.address} name={nav1.name} id={nav1.id} />)

const Navbar = (props) => {
    return (
        <nav className={s.nav}>
            {/*<ToolBar address={"/profile"} name={"Profile"} id={1}/>
            <ToolBar address={"/messages"} name={"Messages"} id={2}/>
            <ToolBar address={"/news"} name={"News"} id={3}/>
            <ToolBar address={"/music"} name={"Music"} id={4}/>
            <ToolBar address={"/settings"} name={"Settings"} id={5}/>*/}
            {addressElement}
        </nav>
    );
};

export default Navbar;
